    vmPeriodoncia.Pronostico = ko.observable("");
    vmPeriodoncia.PronosticoBackup = ko.observable("");
    vmPeriodoncia.Tratamiento = ko.observable("");
    vmPeriodoncia.AccionesClinicas = ko.observable("");
